/***************************************************************************

//	Check UTF8 File
//  IN		:  fi_pFileName - UTF8 File
//  OUT		:  fo_nByte	    - Bytes of UTF8 File
//  RETURN  :  ISUTF8   -  UTF8 File
//             NOTUTF8  -  Not UTF8 File
//			   ELSE		-  ERROR

***************************************************************************/
INT		CharConvert::IsUTF8File(_TCHAR *fi_pFileName, INT *fo_nByte )
{

	BY_HANDLE_FILE_INFORMATION	bhfi;
	HANDLE						hFile;
	_TCHAR						szUTF8Bom[SIZEOFUTF8BOM];
	_TCHAR						szUTFString[20000];
	DWORD						nBytesRead;
	INT							nBytesSource;


	m_UTF8Header = FALSE;


	// FILE READ
	hFile =	CreateFile(fi_pFileName			,
                       GENERIC_READ			,
                       0					,
                       NULL					,
                       OPEN_EXISTING		,
                       FILE_ATTRIBUTE_NORMAL,
                       NULL);
	if (hFile == INVALID_HANDLE_VALUE) 
	{
		return FILE_ERROR;
	}	
	
	GetFileInformationByHandle (hFile, &bhfi);
	if (bhfi.nFileSizeHigh != 0) 
	{
		CloseHandle (hFile);
		return FILE_ERROR;
	}
	
	// Get Bytes of File 
	nBytesSource = bhfi.nFileSizeLow;

	/* first read three bytes and look for BOM */
	if (!ReadFile (hFile, szUTF8Bom, SIZEOFUTF8BOM, &nBytesRead, NULL)) 
	{
		CloseHandle (hFile);
		return FILE_ERROR;
	}

	if (IsUTF8 ((unsigned char*)szUTF8Bom)) 
	{
		*fo_nByte = nBytesSource - SIZEOFUTF8BOM;	
		m_UTF8Header = TRUE;
		CloseHandle (hFile);

		return ISUTF8;
	}
	else
	{
		SetFilePointer(hFile, 0, 0, FILE_BEGIN);
		if (!ReadFile (hFile, szUTFString, 20000, &nBytesRead, NULL)) 
		{
			CloseHandle (hFile);
			return FILE_ERROR;
		}
		
		CloseHandle (hFile);
		*fo_nByte = nBytesSource;

		if ( IsUTF8String((unsigned char*)szUTFString) )
			return ISUTF8;
		else
			return NOTUTF8;
	}
	

	return GENERAL_ERROR;
}

/*******************************************************************************************************/

//    Purpose : Check the First byte is 0xEF and the second byte is 0xBB and the third byte is 0xBF
//    Return  : TRUE  - UTF8 File
//              FALSE - not UTF8 File
//    USES    : Check UTF8 File

/*******************************************************************************************************/
BOOL CharConvert::IsUTF8(PBYTE pb)
{

	if ((*pb == 0xEF) & (*(pb+1) == 0xBB) & (*(pb+2) == 0xBF))  // UTF8 BOM
	{
		return TRUE;
	}
	else
	{
		return FALSE;
	}

	return FALSE;
}

/*******************************************************************************************************/

//    Purpose : Check the string is UTF8, First Byte 0xC0 ~ 0xFD and Second Byte 0x80 ~ 0xBF
//		Code Points			1st Byte   2nd Byte		3rd Byte	4th Byte
//		U+0080 ~ U+07FF		C2 ~ DF		80 ~ BF
//		U+0800 ~ U+0FFF		E0			A0 ~ BF		80 ~ BF
//		U+1000 ~ U+CFFF		E1 ~ EC		80 ~ BF		80 ~ BF
//		U+D000 ~ U+D7FF		ED			80 ~ 9F		80 ~ BF
//		U+D800 ~ U+DFFF		ill-formed (surrogate   )
//		U+E000 ~ U+FFFF		EE ~ EF		80 ~ BF		80 ~ BF
//		U+10000 ~ U+3FFFF	F0			90 ~ BF		80 ~ BF		80 ~ BF
//		U+40000 ~ U+FFFFF	F1 ~ F3		80 ~ BF		80 ~ BF		80 ~ BF
//		U+100000 ~ U+10FFFF F4			80 ~ 8F		80 ~ BF		80 ~ BF
//    Return  : TRUE  - UTF8 File
//              FALSE - not UTF8 File
//    USES    : Check UTF8 File
//
//      :         
//                                     0xC2 ~ C6       0x80 ~ A0 
//                                     0xC2 ~ DF       0xA1 ~ BF   2byte UTF8  .
//                 ,      UTF8  .
/*******************************************************************************************************/
BOOL CharConvert::IsUTF8String(PBYTE pb)
{

	while ( pb )	
	{
		if ( *pb <= 0x80 )
			pb++;
		else if ( ( *pb >= 0xC2 && *pb <= 0xDF ) & ( *(pb+1) >= 0x80 && *(pb+1) <= 0xBF ) )
		{
			if ( (( *pb >= 0xC2 && *pb <= 0xC6 ) & ( *(pb+1) >= 0x80 && *(pb+1) <= 0xA0 )) ||
				 (( *pb >= 0xC2 && *pb <= 0xDF ) & ( *(pb+1) >= 0xA1 && *(pb+1) <= 0xBF )) )
				 pb += 2;
			else return TRUE;
		}		
		else if ( *pb == 0xE0  & ( *(pb+1) >= 0xA0 && *(pb+1) <= 0xBF ) & ( *(pb+2) >= 0x80 && *(pb+2) <= 0xBF ) )
			return TRUE;
		else if ( ( *pb >= 0xE1 && *pb <= 0xEC ) & ( *(pb+1) >= 0x80 && *(pb+1) <= 0xBF ) & ( *(pb+2) >= 0x80 && *(pb+2) <= 0xBF ) )
			return TRUE;
		else if ( *pb == 0xED & ( *(pb+1) >= 0x80 && *(pb+1) <= 0x9F ) & ( *(pb+2) >= 0x80 && *(pb+2) <= 0xBF ) )
			return TRUE;
		else if ( ( *pb >= 0xEE && *pb <= 0xEF ) & ( *(pb+1) >= 0x80 && *(pb+1) <= 0xBF ) & ( *(pb+2) >= 0x80 && *(pb+2) <= 0xBF ) )
			return TRUE;
		else if ( *pb == 0xF0 & ( *(pb+1) >= 0x90 && *(pb+1) <= 0xBF ) & ( *(pb+2) >= 0x80 && *(pb+2) <= 0xBF ) & ( *(pb+3) >= 0x80 && *(pb+3) <= 0xBF ) )
			return TRUE;
		else if ( ( *pb >= 0xF1 && *pb <= 0xF3 ) & ( *(pb+1) >= 0x80 && *(pb+1) <= 0xBF ) & ( *(pb+2) >= 0x80 && *(pb+2) <= 0xBF ) & ( *(pb+3) >= 0x80 && *(pb+3) <= 0xBF ) )
			return TRUE;
		else if ( *pb == 0xF4 & ( *(pb+1) >= 0x80 && *(pb+1) <= 0x8F ) & ( *(pb+2) >= 0x80 && *(pb+2) <= 0xBF ) & ( *(pb+3) >= 0x80 && *(pb+3) <= 0xBF ) )
			return TRUE;
		else
			return FALSE;
	}

	return FALSE;
}

