INT CharConvert::FileCodeChange(TCHAR *sSourceFile, TCHAR *sTempFile)
{
	///   UTF-16 .
	INT		ids, nByte;
	CHAR	*sMultyByte = NULL;
	TCHAR	*sWideByte = NULL;
	TCHAR	sFilePath[64];

	CString strSourceFileCheck;
	strSourceFileCheck.Format( _T("%s"), sSourceFile );
	//===================================================
	//2009.08.20 UPDATE BY PJW : TXT   .
//	if ( strSourceFileCheck.Find(_T(".txt")) < 0 ) return 100;
	INT nPos = 0;

	nPos = strSourceFileCheck.ReverseFind('.');
	strSourceFileCheck = strSourceFileCheck.Mid( nPos + 1 );
	strSourceFileCheck.MakeLower();

	if ( _T("txt") != strSourceFileCheck ) return 100;
	//===================================================
		
	ids = IsUnicodeFile( sSourceFile, &nByte);
	if ( ids < 0 ) return -10;

	if ( ISUNICODE != ids ) {
		ids = ReadAllOfFile( sSourceFile, &sMultyByte, &nByte);
		if ( ids ) return -20;

		ids = IsUTF8File( sSourceFile, &nByte);
		if ( ids < 0 ) {
			free(sMultyByte);
			return -30;
		}

		if ( ISUTF8 != ids ) {
			ids = MultiByteToUnicode(sMultyByte, &sWideByte, &nByte);
			if ( ids ) {
				free(sMultyByte);
				return -40;
			}
		} else {
			ids = UTF8ToUnicode(sMultyByte, &sWideByte, &nByte);
			if ( ids ) {
				free(sMultyByte);
				return -50;
			}
		}

		//_stprintf(sFilePath, _T("\\KOLIS\\WORKFILE\\UNICODE_TEMP_FILE.UNI"));
		//_stprintf(sFilePath, _T("..\\CFG\\UNICODE_TEMP_FILE.UNI"));
		//_tcscpy(sTempFile, sFilePath);

		ids = WriteToFile(sTempFile, sWideByte, nByte);
		free(sMultyByte);
		free(sWideByte);
		if ( ids ) return -60;
	}
	else
		_tcscpy(sTempFile, sSourceFile);

	return 0;
}

